class UserStory:
    def __init__(self, title, description, user_type):
        self.title = title
        self.description = description
        self.user_type = user_type

class Developer(UserStory):
    def log_issue(self, issue):
        print(f"Logging issue: {issue}")

    def update_validation_rules(self, rule_updates):
        print(f"Updating validation rules with: {rule_updates}")

    def prevent_double_publishing(self, submission_id):
        print(f"Preventing double publishing for: {submission_id}")

    def clarify_error_codes(self, error_code):
        print(f"Clarifying error for code: {error_code}")

class UIDesigner(UserStory):
    def redesign_resources_page(self):
        print("Redesigning Resources page to match new styles.")

    def report_user_testing(self):
        print("Reporting user testing results to Agencies.")

    def move_to_round(self, page, round_number):
        print(f"Moving on to round {round_number} of {page} edits.")

    def track_issues(self):
        print("Tracking issues from Tech Thursday.")

class DataUser(UserStory):
    def process_deletions(self, date):
        print(f"Processing deletions for date: {date}")

    def access_fabs_records(self):
        print("Accessing FABS records.")

class AgencyUser(UserStory):
    def include_flexfields(self):
        print("Including a large number of flexfields without performance impact.")

    def deploy_fabs(self):
        print("Deploying FABS into production.")

class BrokerUser(UserStory):
    def submit_data(self):
        print("Submitting data efficiently.")

    def upload_and_validate(self):
        print("Uploading and validating with accurate error messages.")

class FABSUser(UserStory):
    def generate_d_files(self):
        print("Generating D Files from FABS and FPDS data.")

    def download_uploaded_file(self):
        print("Downloading the uploaded FABS file.")

class System:
    def __init__(self):
        self.users = []

    def add_user(self, user):
        self.users.append(user)

    def process_user_stories(self):
        for user in self.users:
            if isinstance(user, DataUser):
                user.process_deletions("12-19-2017")
            elif isinstance(user, UIDesigner):
                user.redesign_resources_page()
                user.report_user_testing()
                user.move_to_round("DABS or FABS landing page", 2)
                user.move_to_round("Homepage", 2)
                user.move_to_round("Help page", 3)
                user.track_issues()
            elif isinstance(user, Developer):
                user.log_issue("Debugging submission issues.")
                user.update_validation_rules("DB-2213 updates")
                user.prevent_double_publishing("submission_123")
                user.clarify_error_codes("CFDA error")
            elif isinstance(user, AgencyUser):
                user.include_flexfields()
                user.deploy_fabs()
            elif isinstance(user, BrokerUser):
                user.submit_data()
                user.upload_and_validate()
            elif isinstance(user, FABSUser):
                user.generate_d_files()
                user.download_uploaded_file()

# Creating a system and adding users
system = System()
system.add_user(DataUser("Data user", "Process deletions for date.", "Data User"))
system.add_user(UIDesigner("UI Designer", "Redesign Resources page.", "UI Designer"))
system.add_user(Developer("Developer", "Log better.", "Developer"))
system.add_user(AgencyUser("Agency User", "Include flexfields.", "Agency User"))
system.add_user(BrokerUser("Broker User", "Submit data.", "Broker User"))
system.add_user(FABSUser("FABS User", "Generate D Files.", "FABS User"))

# Process the user stories
system.process_user_stories()
